(8, '5-264-00257-6', '第一人稱(First Person)', '普丁', '', '俄文書名:От Первого Лица,英文版名為From the first person，在普京的競選團隊支持下於2000年出版）描述了他卑微的出身。根據這本傳記，普京早年生活在社團公寓中，不斷學習以期擁有像蘇聯電影中的官員們一樣的智慧。', 'Вагриус', '2000-01-01', '人文史地', '外文', '', , '2022-05-16', 1, 'admin');
