INSERT INTO `book_data` (`bk_id`, `bk_isbn`, `name`, `bk_author`, `bk_trans`, `bk_intro`, `bk_public`, `bk_publicdate`, `bk_type`, `bk_lang`, `bk_img`, `bk_img_blob`, `apply_date`, `apply_status`, `apply_applicant`) VALUES
(13, '9789573293040', '花的祕密：植物為什麼會開花？', 'Rachel Ignotofsky', '陳雅茜', '《花的祕密》先介紹不同地理環境的代表花卉，如熱帶雨林的大王花、沙漠的仙人掌……並從不同顏色、形狀、大小，帶領讀者領略花朵之美，從而進入花的祕密世界。', '遠流', '2021-10-27', '生活與旅遊', '繁中', 0x433a66616b6570617468696d616765732e6a706567, , '2022-05-17', 1, 'admin'),
(14, '9789866536694', '秘密花園：媲美《哈利波特》的心靈魔法書', 'F．H．勃內特', '楚茵', '這是一部關於大自然魔法和心靈成長的經典名著，也是一部和《哈利波特》一樣領盡風騷的暢銷作品。\n\n　　《哈利波特》的魔法來自幻想，帶給讀者的是奇幻的故事和天馬行空的想像。《秘密花園》的魔法則來自於心靈的力量，訴說著愛和大自然的力量最終會改變一個人的愛情和命運。\n\n　　《秘密花園》不僅是一本適合青少年閱讀的心靈魔法書，同時也是適合成人閱讀的命運魔法書。', '前景', '2018-07-03', '文學小說', '繁中', '', NULL, '2022-05-19', 1, 'admin');
INSERT INTO `book_data` (`bk_id`, `bk_isbn`, `name`, `bk_author`, `bk_trans`, `bk_intro`, `bk_public`, `bk_publicdate`, `bk_type`, `bk_lang`, `bk_img`, `bk_img_blob`, `apply_date`, `apply_status`, `apply_applicant`) VALUES
(22, '9786269554485', '東方慢車謀殺案', '藍霄', '', '本書收錄了過去刊登在《推理》雜誌上的五篇短篇作品，以及讀者引頸期盼已久的新作〈血濃於水〉。登上《推理》雜誌的五篇作品，首次發表於一九九○年十月到一九九六年三月間，橫跨了大約五年，但這些作品仍同樣充滿作者於一九八五年發表的出道作〈屠刀〉般鮮明的感性。', '博識圖書    ', '2022-06-10', '文學小說', '繁中', NULL, , '2022-05-25', 0, 'admin'),
(26, '9789867897015', '小王子', 'Antoine de Saint-Exupery', '張家琪', '　膾炙人口的經典文學《小王子》，自1943年在美國出版以來，迄今已被翻譯成一百多種語言，單單在台灣發行的中譯本就超過50種，閱讀率和閱讀人口更是僅次於《聖經》！而深富散文詩意和人生哲理的故事，更是打動一代代無數大人與小孩的心。\r\n\r\n　　發行全球50餘年；暢銷世界46國。\r\n\r\n　　小王子來自一個很小很小的小行星，在那裡，什麼都好小好小，一天可以看四十三次夕陽。\r\n\r\n　　星球上有三座只到膝蓋高的火山、幾棵猴麵包樹，還有一朵驕傲的玫瑰。\r\n\r\n　　小王子很容易憂傷，他小小的生命溫柔善感。有一天，他和心愛的玫瑰鬧了彆扭，趁著野鳥群遷之際出走，在各星球間遊歷，遇見了國王、愛虛榮的人、酒鬼、商人、點燈人、地理學家，還有狐狸。\r\n\r\n　　最後，他在地球降落，來到了撒哈拉沙漠，和飛行途中迫降在沙漠上的「我」相遇了……', '木馬文化', '2010-01-11', '文學小說', '繁中', NULL, , '2022-05-28', 0, 'admin');

